import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
//import Home from './pages/Home';
import Users from './pages/Users';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/users" component={Users} />
      </Switch>
    </Router>
  );
}

export default App;
